import FormContainer from "./FormContainer";
import '../resources/giphy.mp4'

class Splash extends Component {
  state = {
    videoURL: '../resources.giphy.mp4'
    // videoURL: 'https://giphy.com/gifs/UyThWU6gpAZO0/html5'
  }
  render() {
    return (
      <div>
          Splash Here
          <FormContainer />
          <video id="background-video" loop autoPlay>

            <source src="https://media.giphy.com/media/UyThWU6gpAZO0/giphy.gif" type="video/gif" />
            {/* <source src={this.state.videoURL} type="video/ogg" /> */}
          </video>
        </div>
    );
  }
}

export default Splash;
